import React, { useState } from 'react'
import { IonCard, IonCardSubtitle, IonLabel, IonInput  } from '@ionic/react'


export default function Register() {
  const [userName, setUserName] = useState("")
  const [email, setEmail] = useState("")
  const [userPassword, setPassword] = useState("")

  const handleSubmit = async (e) => {
    e.preventDefault();
    // const res = axios.post("/auth/register", {
    //   username, 
    //   email, 
    //   password,
    // });
    //   console.log(res)
  }

  return (
    <div className="register">
      <div className="registerImgContainer">
        <img className="loginLogo" src='https://static.independent.co.uk/2021/07/19/16/newFile-10.jpg?width=1200&auto=webp&quality=75'alt='dr.eam logo'/>
      </div>
      <form className="registerForm" onIonSubmit={handleSubmit} >
      <IonCard className="registerContainer">
        <IonCardSubtitle className="registerTitle">
          <IonLabel> UserName</IonLabel>
          <IonInput 
            IonInput="text"
            className="registerInput"
            placeHOlder="Enter UserName"
            onIonChange={(e) => setUserName(e.target.value)}>
          </IonInput>
          <IonLabel> Email</IonLabel>
          <IonInput 
            IonInput="text"
            className="registerInput"
            placeHOlder="Enter Email"
            onIonChange={(e) => setEmail(e.target.value)}>
          </IonInput>
          <IonLabel> Password</IonLabel>
          <IonInput 
            IonInput="text"
            className="registerInput"
            placeHOlder="Enter PassWord"
            onIonChange={(e) => setPassword(e.target.value)}>
          </IonInput>
        </IonCardSubtitle>
      </IonCard>
      </form>
    </div>
  )
}
